async def handle_query(update, context):
    q = update.callback_query; await q.answer()
    v = get_user_vault(q.from_user.id, q.from_user.username)
    
    if "SET_" in q.data:
        val = int(q.data.split("_")[1]); context.user_data['payout'] = val
        await q.edit_message_text(f"‚úÖ <b>TARGET SET: ${val}</b>")
    
    elif "INT_" in q.data:
        idx = int(q.data.split("_")[1]); target = OMNI_STRIKE_CACHE[idx]
        payout = context.user_data.get('payout', 100)
        
        # Calculation: Stake = Price * Payout
        s_yes, s_no = target['y_pr'] * payout, target['n_pr'] * payout
        profit = payout - (s_yes + s_no)
        context.user_data['active_arb'] = {'idx': idx, 's_yes': s_yes, 's_no': s_no, 'profit': profit}
        
        desc = (f"‚öñÔ∏è <b>ANALYSIS (CHECK 2/3)</b>\n‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ\n"
                f"<b>YES Stake:</b> ${s_yes:.2f} @ {target['y_pr']}\n"
                f"<b>NO Stake:</b> ${s_no:.2f} @ {target['n_pr']}\n"
                f"<b>Guaranteed Profit:</b> +${profit:.2f}\n‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ")
        
        await q.edit_message_text(desc, reply_markup=InlineKeyboardMarkup([[InlineKeyboardButton("1Ô∏è‚É£ CONFIRM YES LEG", callback_data=f"STEP1_{idx}")]]), parse_mode='HTML')

    elif "STEP1_" in q.data:
        arb = context.user_data['active_arb']
        await q.edit_message_text(f"‚úÖ <b>YES LEG VERIFIED (${arb['s_yes']:.2f})</b>", reply_markup=InlineKeyboardMarkup([[InlineKeyboardButton("2Ô∏è‚É£ CONFIRM NO LEG & EXECUTE", callback_data=f"EXE_{arb['idx']}")]]), parse_mode='HTML')

    elif "EXE_" in q.data:
        idx = int(q.data.split("_")[1]); target = OMNI_STRIKE_CACHE[idx]
        arb = context.user_data['active_arb']
        
        m_proc = await context.bot.send_message(q.message.chat_id, "üëÅÔ∏è <b>FINAL CHECK & EXECUTING...</b>")
        try:
            # CHECK 3: Final profit verification before broadcast
            if arb['profit'] <= 0:
                await m_proc.edit_text("‚ö†Ô∏è <b>STRIKE ABORTED:</b> Profit vanished.")
                return

            client = ClobClient(host="https://clob.polymarket.com", key=v.key.hex(), chain_id=137, signature_type=0, funder=v.address)
            client.set_api_creds(client.create_or_derive_api_creds())
            
            # Atomic Sequential execution
            for tid, stake in [(target['y_tid'], arb['s_yes']), (target['n_tid'], arb['s_no'])]:
                args = MarketOrderArgs(token_id=str(tid), amount=stake, side=BUY, price=0.999)
                signed = await asyncio.to_thread(client.create_order, args)
                await asyncio.to_thread(client.post_order, signed, OrderType.FOK)
            
            await m_proc.edit_text(f"üöÄ <b>STRIKE SUCCESSFUL.</b>\nUSDC deducted from isolated vault.")
        except Exception as e: await m_proc.edit_text(f"‚ö†Ô∏è <b>ERROR:</b> {str(e)[:50]}")

